const Header = (props) =>{

  return(
    <>
      <h1>{props.course}</h1> 
    </>
  )

}

const Part = (props) =>  (
  <p key={props.part.name}>
    {props.part.name} {props.part.exercises}
  </p>
)

const Content = (props) => {
  return (
    <div>
      {props.parts.map(part => (
        <Part part={part}/>
      ))}
    </div>
  )
}

const Total = (props) => {
  return (
    <p>
      Number of exercises {props.exercises}
    </p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course}/>
      <Content parts={parts} />
      <Total exercises={parts.map(part=>part.exercises).reduce((acc, val)=> acc+val, 0)} />
    </div>
  )
}

export default App
